var date=new Date().toLocaleDateString();
var time=new Time().tolocaltime;
ReactDom.render(
  <React.Fragment>
  <h1>My name is {name}.</h1>
  <p>Current date is = {date}</p>
  <p>Current time is = {time}</p>
  </React.Fragment>
  ,document.getElementById("root")
);
